import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
       <NavLink to="/">
       <img src="./logo2"/>
       </NavLink>
       
        <div>
          <NavLink>
          <p>Home</p>
          </NavLink>
          
         <div>
         <FaShoppingCart/>
         </div>
          
        </div>
      </div>
    </div>
  );
};

export default Navbar;
